import './nav-module.css';

function Nav() {
  return (
    
    <nav> 
        
        <img id="my-picture" class="nav-img" src="./Images/My picture.jpg" /> 

        <h2 class="nav-title"> Dev Victor </h2>

    </nav>

  );
}

export default Nav;
